import React from 'react';
import './Footer.css';


function Footer() {
    return (
      <div className="Footer">
        <div className="links">
          <p>Sam's Links</p>
            <a href="https://www.facebook.com/" class="fa fa-facebook"></a><span>Instagram</span>
            <span>Twitter</span>
            <span>Facebook</span>
            <span>GitHub</span>
          <p>Nicoles's Links</p>
            <span>Instagram</span>
            <span>Twitter</span>
            <span>Facebook</span>
            <span>GitHub</span>
        </div>
      </div>
    );
}

export default Footer;
